// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { commonAvatarRenderFunction } from 'js/CommonAvatarService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/CommonAvatarService', () => import('js/CommonAvatarService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {},
    "actions": {
        "render": {
            "method": "commonAvatarRenderFunction",
            "deps": "js/CommonAvatarService"
        },
        "userAvatarAction": {
            "actionType": "Event",
            "method": "Event",
            "inputData": {
                "events": [
                    {
                        "name": "awsidenav.openClose",
                        "eventData": {
                            "id": "globalNavigationSideNav",
                            "commandId": "avatarCommandId",
                            "includeView": "AwGlobalAvatar",
                            "keepOthersOpen": true,
                            "config": {
                                "width": "{{ctx.awSidenavConfig && ctx.awSidenavConfig.avatarPanel && ctx.awSidenavConfig.avatarPanel.width ? ctx.awSidenavConfig.avatarPanel.width : 'STANDARD' }}",
                                "height": "{{ctx.awSidenavConfig && ctx.awSidenavConfig.avatarPanel && ctx.awSidenavConfig.avatarPanel.height ? ctx.awSidenavConfig.avatarPanel.height : 'FULL' }}"
                            }
                        },
                        "excludeLocalDataCtx": true
                    }
                ]
            }
        }
    },
    "ctx": {
        "user.hasThumbnail": null,
        "user.typeIconURL": null,
        "user.thumbnailURL": null,
        "user.cellHeader1": null
    },
    "onEvent": [],
    "i18n": {},
    "messages": {},
    "conditions": {},
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "CommonAvatar",
    "_uniqueViewModelId": "CommonAvatar"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, commonAvatarRenderFunction, undefined, ctxImportObj );

export default Component;
